INSERT INTO `erp_pendencia_dados` VALUES (3,2,3,'Boa tarde,<br><br>\r\n\r\nprimeiramente, a aba \"Colaboradores\" estava apresentando um hardcoded no título, esqueci de tirar na fase de testes, deve estar funcionando normalmente agora.<br><br>\r\n\r\nA questão do dropdown de colaboradores foi resolvida tirando o dropdown e colocando automaticamente a empresa do colaborador na hora do cadastro, tendo em vista que, apenas o adm da empresa tem permissão para a inserção de colaboradores.<br><br>\r\n\r\nAtt',22,'2016-12-12 00:00:00'),(4,3,3,'Já foi resolvido.<br><br>\r\n\r\nEra um problema relativo a uma alteração de permissões que fizemos em cima da hora.<br><br>\r\n\r\nAtt',22,'2016-12-12 00:00:00'),(5,5,3,'Da mesma forma que o dropdown em colaboradores, foi resolvido colocando automaticamente a empresa no release.<br><br>\r\n\r\nAtt',22,'2016-12-12 00:00:00'),(6,4,2,'Esta questão ainda está em desenvolvimento. Logo (em uma ou duas semanas) estará disponível.<br><br>\r\n\r\nAtt',22,'2016-12-12 00:00:00'),(7,7,3,'Atualizei o nome da Mconf Tecnologia na sala 119, e a sala que aparecia em empreendimentos estava errada até porque foi retirado a ligação via banco de dados que tinha entre sala e empreendimento por motivos internos. Sendo assim foi retirado o item \"sala\" da listagem do empreendimento.<br><br>\r\n\r\nAtt',22,'2016-12-13 00:00:00'),(8,6,1,'Solicitado ao inf a troca das lâmpadas.',24,'2016-12-13 00:00:00'),(9,4,3,'Na última atualização do sistema foi adicionada essa feature de inserção de logo e canvas.<br><br>\r\n\r\nAtt',22,'2016-12-14 00:00:00'),(10,8,3,'O sistema foi feito para ser utilizado com o Google Chrome tendo em vista a facilidade de instalação em qualquer sistema (móvel ou desktop). No momento não preparamos o mesmo para outros navegadores, podendo ou não, funcionar nos mesmos.<br><br>\r\n\r\nAtt',22,'2016-12-15 00:00:00'),(11,6,1,'Resolvido. Foram trocadas as 8 lâmpadas no dia 05/01/17. ',24,'2017-01-06 00:00:00'),(12,9,0,'Solicitado ao inf a troca das lâmpadas.',11,'2017-01-09 00:00:00'),(13,6,3,'',24,'2017-01-09 00:00:00'),(14,9,1,'',11,'2017-01-09 00:00:00'),(15,10,2,'Olá!\r\nApesar do desktop não ter placa de patrimônio, vocês tem certeza que é do Instituto de Informática? Receberam de quem? É só para nos ajudar...\r\n1) Neste momento, não há disponibilidade de desktops. Temos um processo de compra pela frente, a partir de computadores de um registro de preços, mas o processo licitatório ainda não foi concluído. Vocês teriam condições de remanejar internamente a máquina antiga com alguém que não esteja trabalhando em desenvolvimento?\r\n2) Também lembro que tínhamos conversado para transferir um dos computadores que estavam na sala da eaware para a sala da mconf. Isso chegou a ser feito?\r\n3) Quanto ao monitor, há disponibilidade. Favor falar com o Eduardo para retirar a peça.\r\nIngrid',22,'2017-01-11 00:00:00'),(16,9,3,'As lâmpadas foram trocadas no dia 24/01/17.',11,'2017-01-26 00:00:00'),(17,10,3,'Foi entregue um computador para a empresa MConf no dia 19/01/17.',22,'2017-01-26 00:00:00'),(18,11,2,'Encaminhado a solicitação a informat.',6,'2017-03-13 00:00:00'),(19,14,1,'Solicitado a demanda ao setor responsável. ',13,'2017-03-23 00:00:00'),(20,16,2,'Pedido de solicitação para limpeza do ar-condicionado realizado. ',24,'2017-03-24 00:00:00'),(21,15,2,'Pedido de solicitação para troca de lâmpada queimada realizado.',24,'2017-03-24 00:00:00'),(22,13,4,'',7,'2017-03-30 00:00:00'),(23,11,3,'Situação resolvida, conserto do piso da sala 120 realizado.',6,'2017-03-31 00:00:00'),(24,17,3,'Troca realizada no dia 04/04/2017.',7,'2017-04-04 00:00:00'),(25,18,2,'A solicitação para conserto da persiana foi encaminhada dia 13/04/17.',11,'2017-04-17 00:00:00'),(26,19,2,'Foi encaminhada a solicitação para troca de duas lâmpadas. ',27,'2017-04-17 00:00:00'),(27,12,3,'Troca efetuada.',6,'2017-04-26 00:00:00'),(28,15,3,'Troca efetuada.',24,'2017-04-26 00:00:00'),(29,19,3,'Troca efetuada.',27,'2017-04-26 00:00:00'),(30,21,2,'Estou em processo de testes do mesmo. Em princípio no sistema hospedado no servidor local o tempo novo funciona, mas lá no servidor do instituto o tempo está fixado em um padrão. Logo terei mais informações.\r\n\r\nAtt',25,'2017-04-27 00:00:00'),(31,22,3,'Era erro no sistema devido a uma falha em um dos testes após a implementação do sistema de auditoria dentro das reservas de sala.\r\n\r\nJá está resolvido.\r\n\r\nAtt',25,'2017-05-03 00:00:00'),(32,18,3,'',11,'2017-05-11 00:00:00'),(33,23,3,'',11,'2017-05-11 00:00:00'),(34,24,3,'',11,'2017-05-11 00:00:00'),(35,24,3,'',11,'2017-05-11 00:00:00'),(36,24,3,'',11,'2017-05-11 00:00:00'),(37,25,1,'Solicitação encaminhada ao setor responsável.',31,'2017-05-17 00:00:00'),(38,14,2,'No final de abril, foi assinado contrato com a nova empresa. A partir disso, iniciou o repasse de solicitações de reparos. A prioridade é para aparelhos que não estão funcionando. Assim, os serviços de limpeza (embora necessários, não são considerados emergenciais) serão feitos apenas na segunda etapa. \r\nDiante das regras vigentes, nós não podemos contratar outra empresa para fazer serviços relativos a aparelhos de ar condicionado. Caso não seja possível esperar, a única maneira possível para efetuar este serviço imediatamente, é por contratação direta (pela empresa). \r\nEntão, esta mensagem é apenas para dizer que continuamos à espera! :-(',13,'2017-05-18 00:00:00'),(39,16,2,'No final de abril, foi assinado contrato com a nova empresa. A partir disso, iniciou o repasse de solicitações de reparos. A prioridade é para aparelhos que não estão funcionando. Assim, os serviços de limpeza (embora necessários, não são considerados emergenciais) serão feitos apenas na segunda etapa. \r\nDiante das regras vigentes, nós não podemos contratar outra empresa para fazer serviços relativos a aparelhos de ar condicionado. Caso não seja possível esperar, a única maneira possível para efetuar este serviço imediatamente, é por contratação direta (pelos usuários das salas). \r\nEntão, esta mensagem é apenas para dizer que continuamos à espera! :-(',24,'2017-05-18 00:00:00'),(40,26,2,'Solicitado a troca das lâmpadas.',10,'2017-05-30 00:00:00'),(41,27,2,'Solicitação encaminhada ao setor responsável.',11,'2017-06-06 00:00:00'),(42,29,2,'Solicitação encaminhada ao setor responsável.',27,'2017-06-08 00:00:00'),(43,29,3,'Troca de lâmpadas realizada no dia 08/06/17.',27,'2017-06-08 00:00:00'),(44,26,3,'Troca de lâmpadas realizada no dia 08/06/17',10,'2017-06-09 00:00:00'),(45,25,3,'Troca de lâmpadas realizada no dia 08/06/17.',31,'2017-06-09 00:00:00'),(46,28,3,'Foi trocado o cartucho no dia 20/06/17 e está funcionando corretamente. ',11,'2017-06-21 00:00:00'),(47,28,3,'Foi trocado o cartucho no dia 20/06/17 e está funcionando corretamente. ',11,'2017-06-21 00:00:00'),(48,30,2,'Encaminhada solicitação para o setor responsável',13,'2017-07-10 00:00:00'),(49,32,2,'Olá,\r\né possível sim, inclusive, criei um usuário para o Leonardo.',22,'2017-07-17 00:00:00'),(50,34,1,'Foi enviado o pedido ao setor responsável.',22,'2017-08-04 00:00:00'),(51,14,2,'Estamos com a empresa licitada para conserto e manutenção dos ar condicionados, não temos previsão para que ocorra o serviço.',13,'2017-08-31 00:00:00'),(52,16,2,'Estamos com a empresa licitada para conserto e manutenção dos ar condicionados, não temos previsão para que ocorra o serviço.',24,'2017-08-31 00:00:00'),(53,20,2,'Estamos com a empresa licitada para conserto e manutenção dos ar condicionados, não temos previsão para que ocorra o serviço.',22,'2017-08-31 00:00:00'),(54,32,3,'',22,'2017-08-31 00:00:00'),(55,31,3,'',22,'2017-08-31 00:00:00'),(56,33,2,'Enviado novamente o pedido de troca de lâmpadas. São poucas pessoas trabalhando com essa atividade, a demora está sendo maior que o habitual.',36,'2017-08-31 00:00:00'),(57,34,3,'',22,'2017-08-31 00:00:00'),(58,35,2,'A informática está elaborando o processo de licitação para conserto de diversas persianas. Infelizmente esse tipo de processo é bem demorado.',27,'2017-08-31 00:00:00'),(59,39,1,'Solicitada a troca junto à secretaria do INF.',13,'2017-09-19 00:00:00'),(60,39,1,'Solicitada a troca junto à secretaria do INF.',13,'2017-09-19 00:00:00'),(61,40,1,'Enviada a solicitação para a Secretaria do INF.',13,'2017-09-27 00:00:00'),(62,38,3,'Foi trocado em 08/2017',11,'2017-09-27 00:00:00');
