INSERT INTO `erp_pendencias` VALUES (2,'Pequenos problemas no software','0','Bom dia.\r\nQuando clico na aba \"Colaboradores\", aparece um ítem \"Colaboradores - Cognitiva Brasil\" e um botão para incluir novos colaboradores. Me parece estranho aparecer Cognitiva Brasil, mas imagino que seja porque a Cognitiva já cadastrou algum colaborador, não sei o que era pra aparecer nessa tela.\r\n\r\nQuando clico pra incluir um novo colaborador, no dropdown \"Empresa\" aparecem diversos ítens sem nome, e o único nome que aparece é \"New Technologies\", o que dá a entender que eu só posso cadastrar colaboradores de outra empresa. Fiz algumas tentativas de cadastro de colaborador, mas não funcionou.',22,'2016-12-12',1,NULL),(3,'Pequenos problemas no software v2','0','Quando cliquei para incluir nova requisição, deu um erro no PHP, pelo que eu entendi por falta de um status (pois eu não modifiquei o campo \"Situação\").',22,'2016-12-12',1,NULL),(4,'Como coloca o logo da empresa?','0','Na aba empreendimentos só existem as opções para baixar o Canvas e o Logo, mas não encontrei onde subir o Canvas e o Logo.',22,'2016-12-12',1,NULL),(5,'Pequenos problemas no software v3','0','Quando clico na aba \"Release\", e depois em \"Novo\", no dropdown \"Selecione a empresa\" aparecem diversos ítens sem nome, e os únicos nomes exibidos são \"CEI\" e \"New Technologies\".',22,'2016-12-12',1,NULL),(6,'Luminárias sala 117','1','As 3 fileiras de lâmpadas da sala 117 estão queimadas ou não estão funcionando. Poderiam verificar?\r\n\r\nAtt.,\r\nRenan',24,'2016-12-12',1,NULL),(7,'Informação incorreta de sala','0','Na aba empreendimentos aparece Mconf Tecnologia na sala 107, não encontrei onde alterar essa informação, o correto é sala 119. No mapa das salas aparece a sala correta, 119, porém com o nome MConf (C maiúsculo).',22,'2016-12-13',1,NULL),(8,'Problema na reserva de salas','0','A máscara de data na reserva de salas não está funcionando no Firefox, o que impossibilita a realização de reserva de salas.\r\nDá uma mensagem de sucesso ao reservar, mas não aparece nas reservas. Não sei se funcionaria em outro navegador.',22,'2016-12-14',1,NULL),(9,'Luminárias','0','Necessário troca de lâmpadas ou reator - 1 luminária - sala 106.\r\nGrato',11,'2017-01-09',1,NULL),(10,'Troca de máquina','0','Boa tarde,\r\nGostaríamos de solicitar a troca de uma máquina em uso na sala 119, um gabinete Dell etiqueta de serviço F9M4JN1, sem etiqueta de patrimônio. É uma máquina Core 2 Quad com 3,7GB de memória, e o motivo da troca é o desempenho insuficiente mesmo para rodar aplicações de escritório (editor de texto, planilha, navegador web).\r\nAproveitando, gostaríamos de se possível atualizar um monitor Dell patrimônio 404412 que tem apenas 17 polegadas, e gostaríamos de substituir por um maior, de preferência wide.',22,'2017-01-11',1,NULL),(11,'Luiz Henrique Boff','1','Solicito o conserto de uma placa do piso da sala 120. Está descolada.',6,'2017-03-13',1,28),(12,'Giane','1','Necessária a troca de lâmpadas da sala 103.',6,'2017-03-22',1,32),(13,'CEI','1','Solicitação à secretária para a troca de lâmpadas da sala 103. ',7,'2017-03-22',1,32),(14,'Thais','0','Solicito que nós envie alguém para limpeza do Ar, sala 108. Obrigada',13,'2017-03-22',1,NULL),(15,'Renan Biegelmeyer da Silva','0','Lampada queimada na sala 117.',24,'2017-03-24',1,NULL),(16,'Renan Biegelmeyer da Silva','0','Solicito a limpeza do filtro do ar-condicionado da sala 117.',24,'2017-03-24',1,NULL),(17,'Eduardo','1','Solicitação à secretária para a troca de lâmpadas da sala 120.',7,'2017-03-27',1,28),(18,'E-AWARE Technologies','1','Problema persiana. Necessário conserto.\r\nGrato\r\nJean',11,'2017-04-17',1,NULL),(19,'NSCAD','0','Olá Equipe CEI! Gostaria de informar que tem um conjunto de duas lâmpadas piscando na sala 122. \r\nDaria para solicitar para o pessoal da manutenção vir arrumar, por favor? Muito obrigada!',27,'2017-04-17',1,NULL),(20,'Ar condicionado','0','Boa tarde,\r\nEstamos com um problema no ar condicionado aqui da sala 119. Ele liga e resfria, porém não conseguimos modificar a temperatura nem nenhuma outra função através do controle remoto.',22,'2017-04-18',1,NULL),(21,'Ingrid','0','Alan: acho que não está funcionando a funcionalidade de manter a janela do \"Gestão\", se a gente não está utilizando o sistema. Podes ver que devo ter atualizado requisições em torno de 10h30 e, quando fui reservar sala às 11h40, perdi a tentativa porque o sistema fechou ao encaminhar o pedido de reserva.\r\nPodes dar uma olhada nisso?',25,'2017-04-26',1,32),(22,'Ingrid','0','Alan:\r\nParece que houve um tilt numa funcionalidade do sistema...\r\nA Tati do NSCAD tinha uma reserva da sala 103 para as 9h30; daí se deu conta que não precisaria mais e cancelou, liberando a sala. Daí apareceu alguém do NSCAD e disse que precisaria de uma sala de reuniões para as 9h30 e pediu para a Tati reservar. Ela tentou e o sistema indicou: \"sala reservada por outra empresa\". Ela olhou no sistema e enxergou a sala como desocupada (ou pelo menos ela não exigia a reserva). Veio aqui no CEI e eu a atendi.\r\nOlhei: sala desocupada. Tentei fazer a reserva e recebi a mensagem:  \"sala reservada por outra empresa\". Olhei novamente e a sala permanecia sem reserva. O NSCAD está lá usando a sala e, até o momento, não apareceu ninguém para usar a sala 103. \r\nA essas alturas, estou convencida que o problema não é de usuário, mas de sistema!...\r\nIngrid',25,'2017-05-03',1,32),(23,'E-AWARE Technologies','0','Conserto persiana. Pedido realizado em 13/04/17, ainda sem retorno.',11,'2017-05-10',1,NULL),(24,'E-AWARE Technologies','0','Limpeza sala.',11,'2017-05-10',1,NULL),(25,'Luís Felipe ','0','Troca ou reparo de lâmpadas na sala 117 - NAPI. ',31,'2017-05-17',1,NULL),(26,'Lâmpada Piscando','1','Temos uma lâmpada que está piscando e fazendo barulho. ',10,'2017-05-29',1,NULL),(27,'E-AWARE','1','Troca reator/lampadas luminária próximo a janela.\r\ngrato',11,'2017-06-05',1,NULL),(28,'Impressora','1','Problema na impressora da cozinha.\r\nImpressão está com falha e baixa qualidade.',11,'2017-06-08',1,NULL),(29,'NSCAD','0','Há um conjunto de 2 lâmpadas que queimou na sala 116. Obrigada!',27,'2017-06-08',1,NULL),(30,'BeeIT','0','Solicito a troca de duas lampadas, é arrumação de uma cortina.\r\nDesda já grata',13,'2017-07-10',1,NULL),(31,'Novo usuário','0','Bom dia, é possível criar uma nova conta para um colaborador no sistema de gestão, especificamente para agendamento de salas?',22,'2017-07-13',1,NULL),(32,'Novo usuário','0','Bom dia, é possível criar uma nova conta para um colaborador no sistema de gestão, especificamente para agendamento de salas?',22,'2017-07-13',1,NULL),(33,'Jerson','2','Troca de lâmpadas queimadas, e verificação do reator. Sala 122.',36,'2017-07-27',1,30),(34,'Fechadura Mconf Tecnologia','0','Bom dia, a fechadura da sala 120, da Mconf Tecnologia, está com problema, a porta não permanece fechada quando não está chaveada, é necessário verificar a instalação da fechadura.',22,'2017-08-04',1,NULL),(35,'NSCAD','0','Olá! o fio de uma persiana da sala 116 do NSCAD rompeu. Verificamos que o fio está bem velho, já arrebentou em dois lugares. Não sei se uma requisição dessas devo enviar para o CEI. Se não for, aguardo suas orientações. Obrigada desde já. ',27,'2017-08-08',1,NULL),(36,'NSCAD','0','Gostaria de informar que os parafusos que prendiam uma persiana da sala 122 afrouxaram, fazendo com que a persiana caisse na sexta dia 01/09. Está faltando parafusos para fixar melhor também.\r\nGostaria de solicitar a manutenção, por favor.',27,'2017-09-04',1,NULL),(37,'NSCAD Lâmpadas','0','Referente à solicitação de lâmpadas que o Jerson informou em julho/agosto, gostaria de informar que a situação na sala 122 piorou: agora 2 dos três conjuntos de lâmpadas estão queimados, ou seja, das 6 lâmpadas, só duas estão funcionando na sala. ',27,'2017-09-05',1,NULL),(38,'E-AWARE','0','Troca e limpeza (filtro) do purificador de água ao lado da máquina de café.\r\nobrigado',11,'2017-09-08',1,NULL),(39,'BeeIT','0','Troca de linha telefônica. sala 108 para sala 113. nosso numero é 33086239. gostaríamos de continuar com o mesmo.\r\n\r\nDesde já grata ',13,'2017-09-19',1,NULL),(40,'BeeIT','0','O rebite da nossa janela esta estragado, assim quando fechamos a janela ela não fica 100 % fechada. ',13,'2017-09-26',1,NULL);
